import React, { useState } from "react";
import Axios from "axios";
// import Navbar from "../navbar";

function Tasks(){

    const [tasks, setTasks] = useState("");
    async function handelSubmit(e){
        e.preventDefault();

    }
    
    function saveTask(){
        Axios.post("http://localhost:5000/api/task" , {tasks : tasks})
        setTasks("")
    }

    return <div>
    {/* <Navbar /> */}
    
    <form className="form" onSubmit={handelSubmit}>
      
      <input className="form-control" onChange={(e)=> setTasks(e.target.value)} value={tasks} type="text" ></input>
      <button onClick={saveTask} type="submit">Submit</button>

      </form>

    </div>
}

export default Tasks;
